DROP TABLE IF EXISTS FoodData;
CREATE TABLE FoodData(
   id          INTEGER  NOT NULL PRIMARY KEY 
  ,description VARCHAR(134) NOT NULL
  ,calories    VARCHAR(5) NOT NULL
  ,protein     NUMERIC(5,2) NOT NULL
  ,carb        VARCHAR(5) NOT NULL
);



DROP TABLE IF EXISTS Games;
CREATE TABLE Games(
   id         INTEGER  NOT NULL PRIMARY KEY 
  ,name       VARCHAR(106)
  ,platform   VARCHAR(32) NOT NULL
  ,release_year VARCHAR(24) NOT NULL
  ,genre      VARCHAR(28)
  ,publisher  VARCHAR(38) NOT NULL
  ,developer  VARCHAR(43)
  ,rating     VARCHAR(55)
);
DROP TABLE IF EXISTS Sales;
CREATE TABLE Sales(
   id    INTEGER  NOT NULL PRIMARY KEY 
  ,na_sales NUMERIC(5,2) NOT NULL
  ,eu_sales VARCHAR(5) NOT NULL
  ,japan_sales NUMERIC(5,2) NOT NULL
  ,other_sales NUMERIC(5,2) NOT NULL
  ,global_sales NUMERIC(5,2) NOT NULL
);
